// PageTest.js
import React from 'react';

const PageTest = ({ onNext }) => {
    return (
        <div style={{ textAlign: 'center', padding: '20px' }}>
            <h1>This is the Page Test</h1>
            <p>Your screen should display 4 BLACK PARALLEL RECTANGLES in one ROW. If not, adjust your browser zoom (Windows/Linux:Control +/-)(Mac:Command +/-)to reach the minimum margin on right and left side on the screen</p>
            <br></br>
            <p>ZOOM IN if you see big gap/space in the left and right margin of your screen or ZOOM OUT if the rectanhgles are devided into two rows and you dont see the "next" button </p>
            {/* Include images as needed */}
            <img src="box.png" alt="Example 1" style={{ width: '450px', margin: '5px' }} />
            <img src="box.png" alt="Example 2" style={{ width: '450px', margin: '5px' }} />
            <img src="box.png" alt="Example 3" style={{ width: '450px', margin: '5px' }} />
            <img src="box.png" alt="Example 4" style={{ width: '450px', margin: '5px' }} />
            {/* Add more images as needed */}
            <br />

            <button
                onClick={onNext} // Function to navigate to the Welcome page
                style={{ marginTop: '20px', padding: '10px 20px', fontSize: '16px' }}
            >
                Next
            </button>
        </div>
    );
};

export default PageTest;
